  \"2015-05-21T23:17:08.951085\",\n\t\"name\": \"vista-4-product-roadmap\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The VistA 4 Product Roadmap outlines how
  the Department of Veterans Affairs (VA), under the direction of the VistA Evolution
  Program, will build upon the previous success and institutional knowledge investment
  in Veterans Health Information Systems and Technology Architecture (VistA) Electronic
  Health Record (EHR). The evolution of VAu00efu00bfu00bds existing EHR product will
  be known as VistA 4. The updated VA EHR system will be interoperable with the EHR
  systems of the Department of Defense (DoD) and other healthcare partners to enhance
  patient-centered, team- and evidence-based care by giving healthcare providers a
  complete picture of a patientu00efu00bfu00bds care and treatment history.\",\n\t\"license_title\":
